impl Solution {
    pub fn sum_imbalance_numbers(nums: Vec<i32>) -> i32 {
        let mut result = 0;
        let n = nums.len();
        for i in 0..n {
            let mut min = nums[i];
            let mut max = nums[i];
            let mut freq = vec![0; n + 1];
            freq[nums[i] as usize] += 1;
            for j in i + 1..n {
                min = min.min(nums[j]);
                max = max.max(nums[j]);
                freq[nums[j] as usize] += 1;
                let mut imbalance = 0;
                let mut prev = -1;
                for k in (min as usize)..=(max as usize) {
                    if freq[k] > 0 && prev >= 0 && k as i32 - prev > 1 {
                        imbalance += 1;
                    }
                    if freq[k] > 0 {
                        prev = k as i32;
                    }
                }
                result += imbalance;
            }
        }
        result
    }
}
